int main(void)
{
    init_interrupt();
    
    
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	// declare other variables(not shown)
	// initialize location and direction of rectangles(not shown)

	/* set front pixel buffer to start of FPGA On-chip memory */
	*(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
                                    	// back buffer
	/* now, swap the front/back buffers, to set the front buffer location */
	wait_for_vsync();
	/* initialize a pointer to the pixel buffer, used by drawing functions */
	pixel_buffer_start = *pixel_ctrl_ptr;
	clear_screen(); // pixel_buffer_start points to the pixel buffer
	/* set back pixel buffer to start of SDRAM memory */
	*(pixel_ctrl_ptr + 1) = 0xC0000000;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
	clear_screen(); // pixel_buffer_start points to the pixel buffer
    
    
    //volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	/* Read location of the pixel buffer from the pixel buffer controller */
	//pixel_buffer_start = *pixel_ctrl_ptr;
    
    volatile int *sw_ptr = 0xFF200040;
    
    //whether in start page
    bool in_start_page = true;
    
    //which buffer
    bool first_buffer = true;
    
    int sw_value = 0;
    
    while(1)
    {
        while(in_start_page)
        {
            startPage();
            wait_for_vsync();
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            sw_value = *sw_ptr;

            game_end = false;
            
            if(sw_value == 1)
            {
                set_one();
                in_start_page = false;
                
                clear_screen();
                wait_for_vsync();
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
                clear_screen();
                draw_main();
                
                break;
            }
            else if(sw_value == 2)
            {
                set_two();
                in_start_page = false;
                
                clear_screen();
                wait_for_vsync();
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
                clear_screen();
                draw_main();

                break;
            }
        }
        
   	    draw_main();

        //when mouse choose one car
        while(car_chosen_by_mouse != -1){
            draw_main();

            //game end
            if(car_set[7].bottomRight_x > 275){
                game_end = true;
                in_start_page = true;
                break;
            }          
        }

        if (game_end == true) {
            //print end page
            for(int i = 0; i < 50; ++i){
                const static volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
                clear_screen();
                endPage();
                wait_for_vsync();
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            }

            clear_screen();
            wait_for_vsync();
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            clear_screen();

            sw_value = 0;
            //wait 5 seconds
        }
    }
}

