void wait_for_vsync(){
	volatile int* pixel_ctrl_ptr=(int*) 0xFF203020;
	register int status;
    
	*pixel_ctrl_ptr=1;//start the synchronization process
    
	status=*(pixel_ctrl_ptr+3);//read status
	while((status&0x01)!=0){// read only s bit, wait for s to become 0
        	status=*(pixel_ctrl_ptr+3); //reset s bit
	}
    buffer_idx = 1 - buffer_idx;
}

void wait_seconds(){
    for(int i = 0; i < 200; ++i){
        volatile int* pixel_ctrl_ptr=(int*) 0xFF203020;
        register int status;
        
        *pixel_ctrl_ptr=1;//start the synchronization process
        
        status=*(pixel_ctrl_ptr+3);//read status
        while((status&0x01)!=0){// read only s bit, wait for s to become 0
                status=*(pixel_ctrl_ptr+3); //reset s bit
        }
        buffer_idx = 1 - buffer_idx;
    }
}


void draw_line(int x1_i, int y1_i, int x2_i, int y2_i, short int line_color)
{
    int x1, x2, y1, y2;
	x1 = MIN(x1_i, x2_i);
	x2 = MAX(x1_i, x2_i);
	y1 = MIN(y1_i, y2_i);
	y2 = MAX(y1_i, y2_i);
    
    if(x1 == x2)
    {
   	 for(int i=y1;i<=y2;i++)
   	 {
   		 plot_pixel(x1,i,line_color);
   		 plot_pixel(x1+1,i,line_color);
   		 plot_pixel(x1-1,i,line_color);
   	 }
    }
    else if(y1==y2)
    {
   	 for(int i=x1;i<=x2;i++)
   	 {
   		 plot_pixel(i,y1,line_color);
   		 if(y1==0)
   		 {
   			 plot_pixel(i,y1+1,line_color);
   			 plot_pixel(i,y1+2,line_color);
   		 }
   		 else if(y1==239)
   		 {
   			 plot_pixel(i,y1-1,line_color);
   			 plot_pixel(i,y1-2,line_color);
   		 }
   		 else
   		 {
   			 plot_pixel(i,y1+1,line_color);
   			 plot_pixel(i,y1-1,line_color);
   		 }
   	 }
    }
}

