void keyboard_interrupt_handler()
{
	const static volatile int* keyboard_ptr = (int *) 0xff200100;
	keyboard_input_buffer[2] = keyboard_input_buffer[1];
	keyboard_input_buffer[1] = keyboard_input_buffer[0];
	keyboard_input_buffer[0] = (*keyboard_ptr) & 0xFF;
	if (keyboard_input_buffer[1] != 0xF0)
	{
    	return;
	}

	if (keyboard_input_buffer[2] == 0xE0)
	{
    	// Arrows: make code is 2 byte long.
    	// Using keyboard_input_buffer[0] to determine which arrow is pressed.
    
        //0 -> horizontal
        //1 -> vertical
        int dir = direction(car_set[car_chosen_by_mouse].topRight_x - car_set[car_chosen_by_mouse].bottomLeft_x, 
                            car_set[car_chosen_by_mouse].bottomLeft_y - car_set[car_chosen_by_mouse].topRight_y);

        //up arrow    
        if(keyboard_input_buffer[0] == 0x75){
            //check if the car is move in the valid direction
            if (dir == 1)
                move_up();
        }
   		 
        //right arrow
        if(keyboard_input_buffer[0] == 0x74){
            if (dir == 0)
                move_right();
        }
            
        //left arrow
        if(keyboard_input_buffer[0] == 0x6B){
            if (dir == 0)
                move_left();
        }
            
        //down arrow
        if(keyboard_input_buffer[0] == 0x72){
            if (dir == 1)
                move_down();
        }  
	}
	else
	{

    	// Make code is 1 byte long.
	}

	// Update your game based on your input.
}

void mouse_interrupt_handler()
{
	const static volatile int* mouse_ptr = (int *) 0xff200108;
	int data = (*mouse_ptr);
	static int counter = 0;
	if (data & 0x8000)
	{
    	// Check if the input is valid.
    	mouse_input_buffer[2] = mouse_input_buffer[1];
    	mouse_input_buffer[1] = mouse_input_buffer[0];
    	mouse_input_buffer[0] = data & 0xFF;
    	++counter;
	}
	if (counter == 3)
	{
    	// We have recieved all three bytes of data.
    	// Update the current state.
    	counter = 0;
    	bool left_click = mouse_input_buffer[2] & 0x1;
    	bool neg_x = mouse_input_buffer[2] & 0x10;
    	bool neg_y = mouse_input_buffer[2] & 0x20;
    	int x_move = mouse_input_buffer[1];
    	int y_move = mouse_input_buffer[0];
    	if (neg_x)
    	{
        	x_move += 0xFFFFFF00;
    	}
    	if (neg_y)
    	{
        	y_move += 0xFFFFFF00;
    	}

   	 
   	 // 320 * 240
   	 global_x += x_move;
    	global_x = MAX(3, global_x);
    	global_x = MIN(317, global_x);

   	 global_y += y_move;
    	global_y = MAX(3, global_y);
    	global_y = MIN(237, global_y);
   	 printf("x: %d\n", global_x);
    	printf("y: %d\n\n", global_y);
    	// Update mouse location.
    	// If left click, do whatever you want...
   	 
   	 if(left_click)
   	 {
   		 get_car_index(global_x, global_y);
   		 
   	 }
	}   
}

